        "rek_notes": "This book is written in a patient-centered format. It includes common symptoms and diseases. The texts are presented in English and Chinese side by side on the same page. Readers can look up in Section 1 in the table of content of the book for a main symptom. The symptoms are organized according to the body-parts and some symptoms that are specific to female, male and children are grouped under the chapters female problems, male problems and children problems respectively. They will find the relevant information under the headings The possible causes and Important information that you shall tell your doctor which contain the relevant and important points to discuss with their doctor. Common topics which may not be specific to a symptom such as drug allergy, smoking, and breaking bad news will be found in the section Common topics. When a diagnosis is discussed, the reader can look up in Section 2 in the table of content for a relevant diagnosis. The diagnoses are organized according to the body-parts. Diagnoses specifically related to female, male and children are grouped under the chapters womens health, mens health, and childrens health respectively. Readers will find the relevant findings and the relevant treatment which include the relevant points that a family doctor may tell his/her patient. The reader can use those points to discuss with their doctor. For example, if the doctor does not explain the relevant findings or the possible causes for the illness, the reader can make use of the points listed in the chapter to discuss with their doctor. The chapters are organized according to body- parts because patients may not familiar with body-systems such as endocrinology, but they are familiar with body-parts. Alternatively, readers can find the relevant topics by looking up the index section at the end of the book."
