    "rek_description_xsdmf_id": null,
    "rek_description": "Injuries are a leading cause of death and burden of disease in persons younger than 60 years of age (Peden et al., 2002) and it has been estimated that in 2000, injuries accounted for 9% of the worlds deaths and 12% of the worlds burden of disease (WHO, 2002). Injuries follow a strong gender pattern and injury mortality among men is twice that among women. Injuries affect mainly young, economically active adults between the ages of 15 and 44 years with this age group accounting for almost 50% of the worlds injury-related mortality (WHO, 2002). More than 90% of the worlds deaths from injuries occur in low- and middle-income countries (WHO, 2002). Males in Africa and the low- and middle-income countries of Europe have the highest injury-related mortality rates worldwide. Among females, the highest injuryrelated mortality rates are found in Africa and India. Zwi et al. highlight this neglected health problem in developing countries and argue for an immediate policy response (Zwi et al.,",
